import React, { Component } from 'react';
import { Container, Jumbotron,Row,Col } from 'reactstrap';
import { Media } from 'reactstrap';

class Profile extends Component {
    constructor(props){
        super(props);
    }
  render()
   {
    return (
      <Jumbotron>
        <Media>
         
          <div class="media">
          <Container>
           <img class="align-self-center mt-3" src="holder.js/171x180" alt="Avatar"roundedCircle></img>
          </Container>
          <Container>
           <Row>
             <Col sm="8">
          
            <div class="media-heading">
             <h1 class="mt=5" >Username</h1>
            </div>
             </Col>
           </Row> 
          </Container>
          </div>
         
        </Media>
      </Jumbotron>
    );
   };
}

export default Profile
